class DynamicSuite{static call(e,a,t){fetch(`/dynamicsuite/api/${e}`,{method:"POST",body:JSON.stringify(a||[])}).then(e=>{if(e.ok)return e;throw new Error("A server error has occurred")}).then(e=>e.json()).then(e=>t(e),()=>t({status:"SERVER_ERROR",message:"A malformed response was returned",data:null})).catch(e=>{console.log(e),t({status:"SERVER_ERROR",message:"A malformed response was returned",data:null})})}}DynamicSuite.vm=new Vue({name:"DynamicSuite",el:"#dynamicsuite",data:()=>({has_session:!1,hide_overlay:!0,overlay_nav_tree:null,overlay_title:null,overlay_actions:null}),mounted(){if("object"==typeof window.ds_window_data)for(const e of["has_session","hide_overlay","overlay_nav_tree","overlay_title","overlay_actions"])void 0!==window.ds_window_data[e]&&(this[e]=window.ds_window_data[e])}});Vue.component("ds-overlay",{template:'<div id="ds-overlay"><div class="nav-button"><i class="fas fa-bars"></i></div><div class="title">{{$root.overlay_title}}</div><div class="actions"><i class="fas fa-user"></i></div></div>'});